import Layout from '../components/MyLayout';
import Link from 'next/link';

// import HachiPic from '../public/static/Hachi.jpeg';


export default function Blog() {
  return (
    <Layout>
        <div>
      <h1>Morgan T Shaw</h1>
      <p>Passionate software developer with a knack for problem solving. I enjoy the outdoors, trying new things, and spending time with my dog Hachi!</p>
      <img src='{HachiPic}' alt="dog on water front" />

        </div>

      <style jsx>{`
        h1,
        a {
          font-family: 'Arial';
        }

        ul {
          padding: 0;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </Layout>
  );
}
